export default function Footer() {
  const currentYear = new Date().getFullYear();

  return (
    <div>
      <footer className="mt-8 p-4 border text-center bg-red-500 text-white container mx-auto rounded">
        &copy; {currentYear} Egon Saks
      </footer>
    </div>
  );
}
